# -*- coding: utf-8 -*-
def casesVoisines(i, j, dim):
    """
    Renvoie les cases voisines d'une case donnée sur une grille
    @param i , j : int positif < dim coordonées de k
    @param dim : int > 0, dimension de la grille carrée
    @return voisins : liste de couples, coordonnées des cases voisines
                        de la case de coordonnées (i,j)
    """
    voisins = []
    i_max = dim - 1
    if i == 0:
        if j == 0:
            voisins = [(0, 1), (1, 1), (1, 0)]
        elif j == i_max:
            voisins = [(0, i_max - 1), (1, i_max), (1, i_max - 1)]
        else:
            voisins = [(0, j - 1), (0, j + 1), (1, j - 1), (1, j), (1, j + 1)]
    elif i == i_max:
        if j == 0:
            voisins = [(i_max, 1), (i_max - 1, 1), (i_max - 1, 0)]
        elif j == i_max:
            voisins = [(i_max, i_max - 1), (i_max - 1, i_max), (i_max - 1, i_max - 1)]
        else:
            voisins = [(i_max, j - 1), (i_max, j + 1), (i_max - 1, j - 1), (i_max - 1, j), (i_max - 1, j + 1)]
    else:
        if j == 0:
            voisins = [(i - 1, 0), (i - 1, 1), (i, 1), (i + 1, 0), (i + 1, 1)]
        elif j == i_max:
            voisins = [(i - 1, i_max), (i - 1, i_max - 1), (i, i_max - 1), (i + 1, i_max), (i + 1, i_max - 1)]
        else:
            voisins = [(i - 1, j - 1), (i - 1, j), (i - 1, j + 1),
                       (i, j - 1), (i, j + 1),
                       (i + 1, j - 1), (i + 1, j), (i + 1, j + 1)]

    return voisins


def afficheGrille(grille):
    for i in range(len(grille)):
        for j in range(len(grille[i])):
            if grille[i][j]["mine"] and not grille[i][j]["cache"]:
                print("X", end=" ")
            elif not grille[i][j]["mine"] and not grille[i][j]["cache"]:
                print(grille[i][j]["bombes_v"], end=' ')
            else:
                print("?", end=' ')
        print()


afficheGrille()


